import React from 'react';

function UserDashboard() {
  return (
    <div className="bg-blue-500 min-h-screen">
      <h1>User Dashboard</h1>

      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="py-8">
          <h1 className="text-3xl font-bold leading-tight text-gray-900">Packages</h1>
          <p className="mt-1 text-lg text-gray-600">Choose the package that suits you best.</p>
        </div>
        
        <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-4">
          {/* Chart component */}
          <div className="bg-white p-4 rounded shadow">
            <h2 className="text-lg font-bold mb-2">Chart</h2>
            {/* Add your chart component here */}
          </div>
          
          {/* New classes component */}
          <div className="bg-white p-4 rounded shadow">
            <h2 className="text-lg font-bold mb-2">New Classes</h2>
            {/* Add your new classes component here */}
          </div>
          
          {/* Attendance count component */}
          <div className="bg-white p-4 rounded shadow">
            <h2 className="text-lg font-bold mb-2">Attendance Count</h2>
            {/* Add your attendance count component here */}
          </div>
        </div>
      </div>
    </div>
  );
}

export default UserDashboard;
